def calculate_score(peptide: str, sh2: str) -> float:
    """Calculate a reSMALI score from a given 6 residue motif and sh2 domain

    Args:
        peptide (str): A 7 residue motif in the format xxYxxxx .
        sh2 (str): SH2 domain.
    
    Returns:
        float: resmali score.

    """

    # Validate peptide before scoring
    if len(peptide) != 7:
        raise ValueError("Peptide length must be 7 residues")
    peptide = peptide.upper()
    if peptide[2] != "Y":
        raise ValueError("Peptide sequences must be xxYxxxx")

    # Make sure sh2 domain exists
    try:
        score_array = score_matrix_dict[sh2]
    except ValueError as exc:
        raise ValueError("SH2 domain " + sh2 + " not found") from exc

    peptide = peptide[0:2] + peptide[3:7]
    score = 0

    for charno in range(0, 6):
        try:
            score = score + score_array[charno][aa_dict[peptide[charno]]]
        except ValueError as exc:
            raise ValueError("The amino acid residues in " +
                             peptide + " were not recognised") from exc

    return round(score, 2)


def get_resmali_seq(protein_seq: str) -> list:
    """Generate a list with the position of tyrosines (0 indexed) and associated reSMALI motif 
    
    Args:
        protein_seq (str): Amino acid sequence of protein of interest (1 letter amino acid code).
    
    Returns:
        list: Returns a list of of lists with the format [tyrosine position, reSMALI motif]
    
    """
    ret_list = []
    protein_len = len(protein_seq)
    protein_seq = protein_seq.upper()
    for position in range(2, protein_len - 4):
        if protein_seq[position] == 'Y':
            ret_list.append([position, protein_seq[position-2:position+5]])

    return ret_list


def predict_protein(protein_seq, sh2=None, local_threshold='preset'):
    """Generate predictions of phosphotyroine-SH2 domain binding for a protein sequence.

    Args:
        protein_seq (str): Amino acid sequence of a protein of interest in 1 letter AA format.
        sh2 (list) : List of SH2 domains for reSMALI scores to be calculated for.
        local_threshold (str/float):  Threshold for reSMALI score to predict binding.
            Defaults to 'preset'. When set to 'preset' a predetermined threshold for
            each SH2 domain will be used, which equals a score in the top 5% of motifs
            in the human genome.
    
    Returns:
     list: Returns a list containing [Tyrosine positon, motif, SH2 domain, sh2_threshold, reSMALI score ]"""
    if sh2 is None:
        sh2 = score_matrix_dict.keys()
    seqlist = get_resmali_seq(protein_seq)
    ret_list = []
    for sh2motif in sh2:
        if local_threshold == 'preset':
            sh2_threshold = threshold.get(sh2motif)
        else:
            sh2_threshold = local_threshold
        for positon, sequence in seqlist:
            score = calculate_score(sequence, sh2motif)
            if score > sh2_threshold:
                ret_list.append(
                    [positon, sequence, sh2motif, sh2_threshold, score])

    return ret_list


def condensed_list(protein_seq, sh2=None, local_threshold='preset'):
    """Generate predictions of phosphotyroine-SH2 domain binding for a protein sequence,
    with the results returned in a codensed list format.

    Args:
        protein_seq (str): Amino acid sequence of a protein of interest in 1 letter AA format.
        sh2 (list) : List of SH2 domains for reSMALI scores to be calculated for.
        local_threshold (str/float):  Threshold for reSMALI score to predict binding.
            Defaults to 'preset'. When set to 'preset' a predetermined threshold for
            each SH2 domain will be used, which equals a score in the top 5% of motifs
            in the human genome.
    
    Returns:
     list: Returns a list containing [Tyrosine positon, motif, SH2 domain, sh2_threshold, reSMALI score ]"""
    full_list = predict_protein(protein_seq, sh2, local_threshold)
    df = pd.DataFrame(full_list, columns=[
                      "Position", "Sequence", "SH2_motif", "SH2_threshold", "score"])
    position_list = pd.unique(df['Position'])
    output_list = list()
    for position in position_list:
        df_loc = df.loc[df['Position'] == position]
        sh2_domains = pd.unique(df_loc['SH2_motif']).tolist()
        output_list.append([position, sh2_domains])

    return output_list


def unique_list_values(list1):
    """Get only the unique values contained within a list"""
    unique_list = []
    for x in list1:
        if x not in unique_list:
            unique_list.append(x)
    return unique_list
